import VueRouter from 'vue-router'
import index from '@/pages/index'
import event from '@/pages/event'


export default new VueRouter({
    mode: 'history',
    routes: [
        {
            path: '',
            component: index,
        },
        {
            path: '/event',
            component: event,
        }
    ]
})
